		static bool ValidSeedDay0(int seed, bool report = false)
        {
			var bundles = RemixedBundles.Generate(seed);
			if (!bundles.Satisfies(DesiredBundles))
			{
				return false;
			}

			if (bundles.Contains(KillerBundles))
			{
				return false;
			}

			List<Location> locations = new()
			{
				new Location("Backwoods", seed),
				new Location("BusStop", seed),
				new Location("Beach", seed),
				new Location("Town", seed),
				new Location("Forest", seed),
				new Location("Mountain", seed)
			};

			int artifact = 0;
			int leek = 0;
			int horseradish = 0;
			int dandelion = 0;
			int daffodil = 0;
			foreach (var location in locations)
			{
				location.RunToDay(1);

				if (location.Name != "Mountain")
				{

					artifact += location.ArtifactSpots.Select(i=>i).Where(i=>i.Item2 == "(O)590" && (location.Name != "Beach" || i.Item1.X < 57)).Count();
				}

				leek += location.ForageSpawns.Select(i => i).Where(i => i.Value.Name == "Leek").Count();
				horseradish += location.ForageSpawns.Select(i => i).Where(i => i.Value.Name == "Wild Horseradish").Count();
				dandelion += location.ForageSpawns.Select(i => i).Where(i => i.Value.Name == "Dandelion").Count();
				daffodil += location.ForageSpawns.Select(i => i).Where(i => i.Value.Name == "Daffodil").Count();
			}

			if (artifact < 4)
			{
				return false;
			}

			if (leek < 1 || horseradish < 1 || dandelion < 1 || daffodil < 1)
			{
				return false;
			}

			if (report)
			{
				string output = $"{seed}	{artifact}	{leek}	{horseradish}	{dandelion}	{daffodil}";
				Console.WriteLine(output);

				FileStream fs = null;
				int i = 0;
				while (fs == null)
				{
					try
					{
						fs = new FileStream($"DynamicCCReport{i}.txt", FileMode.Append);
					}
					catch
					{
						i++;
					}
				}
				StreamWriter stream = new StreamWriter(fs);
				stream.WriteLine(output);
				stream.Close();
			}

			return true;
        }

