        public static bool ValidSeedDay2(int seed, bool curate=false)
        {
			Quests.QuestResults quest = Quests.GetQuest(seed, 2, true, personsKnown: new List<string>() { "Robin", "Lewis" });
			if (quest.Type == Quests.QuestType.None)
			{
				return false;
			}

			var items = Location.digUpArtifactSpot(1, seed, "Forest", 66, 70);
			bool ancientSeed = false;
			foreach (var item in items)
			{
				if (item.Item1 == "114")
				{
					ancientSeed = true;
					break;
				}
			}

			if (!ancientSeed)
			{
				return false;
			}
			// DishOfTheDay
			Trash1_6.Trash.TrashItem trash = Trash1_6.Trash.getTrash(seed, 2, Trash1_6.Trash.Can.Gus, luck:0.1);
			if (trash.Id != "DishOfTheDay")
			{
				return false;
			}

			Location beach = new Location("Beach", seed);
            beach.Day = 2;

            beach.ProcessBubbles();

            int totalTime = 0;
            foreach (var bubbles in beach.Bubbles)
            {
                if (bubbles.Distance < 3 || bubbles.X > 57)
                {
                    continue;
                }

				if (bubbles.EndTime < 1900)
					totalTime += bubbles.TotalMinutes();
				else if (bubbles.StartTime >= 1900)
				{
					break;
				} else
				{
					totalTime += bubbles.TotalMinutes(bubbles.StartTime, 1900);
				}
            }

            if (totalTime < 560)
            {
                return false;
            }
			Console.WriteLine(totalTime);
            if (curate)
            {
                int value = 0;
                for(int i=0; i<5; i++) { 
                    (int,int) content = Mines.GetGeodeContents(seed, i+2, Geode.Geode);
                    int cost = ObjectInfo.Items[content.Item1].Cost;
                    value += cost * content.Item2;
                }
                string output = $"{seed}	{totalTime}	{quest}	{value}	{trash.Id}, {trash.MinLuck}	{String.Join(",", beach.Bubbles)}";


				Console.WriteLine(output);

				FileStream fs = null;
				int j = 0;
				while (fs == null)
				{
					try
					{
						fs = new FileStream($"DynamicCCReportDay2{j}.txt", FileMode.Append);
					}
					catch
					{
						j++;
					}
				}
				StreamWriter stream = new StreamWriter(fs);
				stream.WriteLine(output);
				stream.Close();
			}

            return true;
        }

