        public static bool UsefulCarts(int seed, bool report = false)
        {

            var stock = TravelingCart.GetStock(seed,0);
			HashSet<string> stockIds = new HashSet<string>(stock.Select(o => o.Id));
			
			var requiredStock = stockIds.Intersect(RequiredItems.Union(ArtisanItems));

            int count = stockIds.Intersect(RequiredItems).Count();

            if (count < 6)
            {
                return false;
            }
			if (report)
			{
				HashSet<string> stockNames = new HashSet<string>(requiredStock.Select(o => Item.Get(o).Name));

				string output = $"{seed}	{count}	{String.Join("	", stockNames.OrderBy(s=>s))}";
				Console.WriteLine(output);

				FileStream fs = null;
				int i = 0;
				while (fs == null)
				{
					try
					{
						fs = new FileStream($"DynamicCCReport{i}.txt", FileMode.Append);
					}
					catch
					{
						i++;
					}
				}
				StreamWriter stream = new StreamWriter(fs);
				stream.WriteLine(output);
				stream.Close();
			}
            //count = stockIds.Intersect(ArtisanItems).Count();

            //if ( count < 3)
            //{
            //    return false;
            //}
            return true;
        }

