        // parallel search
        public static double Search(int start, int end, int blockSize, out List<int> validSeeds)
        {
            Stopwatch stopwatch = Stopwatch.StartNew();
            var bag = new ConcurrentBag<int>();
            var partioner = Partitioner.Create(start, end, blockSize);
			//(int, int) range = (start, end);
            Parallel.ForEach(partioner, (range, loopState) =>
            {
                for (int seed = (int)range.Item1; seed < range.Item2; seed++)
                {
                    if (seed % 2 == 0) { continue; }
					//Console.WriteLine(seed);
                    if (ValidSeedDay2(seed))
                    {
                        bag.Add(seed);
						FileStream fs = null;
						int i = 0;
						while (fs == null)
						{
							try
							{
								fs = new FileStream($"DynamicCCDay2{i}.txt", FileMode.Append);
							}
							catch
							{
								i++;
							}
						}
						StreamWriter stream = new StreamWriter(fs);
						stream.Write($"{seed},");
						Console.WriteLine(seed);
						stream.Close();
                    }
                }
            }
			);
            double seconds = stopwatch.Elapsed.TotalSeconds;
            Console.WriteLine($"Found: {bag.Count} sols in {seconds.ToString("F2")} s");
            validSeeds = bag.ToList();
            validSeeds.Sort();
            return seconds;
        }

